INSERT INTO `about` (`id`, `img_name`, `content`, `date`, `status`) VALUES
(8, '4150b-about-01.jpg', '<p>\n	&nbsp;</p>\n<p>\n	<strong>บริษัท สมาร์ท ชัวร์ จำกัด</strong> มุ่งเน้นให้คำปรึกษาและดำเนินธุรกิจเกี่ยวกับบริการหลังการขายอย่างครบวงจรสำหรับผู้ประกอบการด้านรถยนต์โดยเฉพาะ โดยทางบริษัทจะคัดสรรบริการหลากหลายรูปแบบ ไม่ว่าจะเป็นโปรแกรมขยายเวลารับประกันอะไหล่รถยนต์ บริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง บริการด้านการจัดการบริหารการเคลม เป็นต้น เพื่อให้คุ้มค่า เหมาะสม ตรงตามความต้องการและลูกค้าได้รับประโยชน์สูงสุด อีกทั้งยังมุ่งมั่นพัฒนาคุณภาพการให้บริการและศักยภาพของพนักงานอย่างต่อเนื่อง โดยการฝึกอบรมพนักงานให้มีความรู้ ความเข้าใจตามมาตรฐานวิชาชีพและความรู้ด้านผลิตภัณฑ์ต่างๆ นอกจากนี้เรายังนำเทคโนโลยีมาเพื่อช่วยบริหารจัดการระบบต่างๆ ไม่ว่าจะเป็นด้านการขาย การเปิดความคุ้มครอง และด้านการจัดการบริหารการเคลม เป็นต้น ดังนั้นบริษัท สมาร์ท ชัวร์ จำกัด จึงได้ชื่อว่าเป็นหนึ่งในบริษัทบริการหลังการขายสำหรับผู้ประกอบการด้านรถยนต์ที่ใหญ่ที่สุดในอาเซียน</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong><u>Our Vision</u></strong></p>\n<p>\n	&ldquo;To make the Used car market more efficient&nbsp;and transparent&rdquo;</p>\n<p>\n	เรามุ่งมั่นที่จะพัฒนาตลาดรถยนต์มือสองให้มีประสิทธิภาพและโปร่งใส</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong><u>Our Mission</u></strong></p>\n<p>\n	&ldquo;To become the Gold standard for Safety, Quality and Trust in the used car market&rdquo;</p>\n<p>\n	เรามุ่งมั่นที่จะพัฒนาตลาดรถยนต์มือสองให้เป็นที่ยอมรับในระดับมาตรฐานสากล</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong style=\"font-size: 18px;\"><u>บริการของเรา</u></strong></p>\n<p>\n	<strong>บริการด้าน </strong><strong>Extended Warranty</strong></p>\n<p>\n	ให้บริการด้านโปรแกรมขยายเวลารับประกันอะไหล่รถยนต์ โดยทางบริษัทจะดูแลค่าใช้จ่ายในการซ่อมอะไหล่รถยนต์ ทำให้ลูกค้าอุ่นใจ ไร้กังวลเรื่องค่าใช้จ่าย อีกทั้งทางบริษัทยังมีโปรแกรมขยายเวลา การรับประกันอะไหล่รถยนต์ไว้ให้เลือกอย่างหลากหลาย เพื่อให้เหมาะสม และตรงตามความต้องการของลูกค้าอย่างสูงสุด นอกจากนี้ ทางบริษัทยังมีพันธมิตรทั้งศูนย์บริการและอู่ในเครือมากกว่า 5,000 แห่ง ครอบคลุมทั่วประเทศไทย</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>บริการด้าน 24</strong><strong> Hour Emergency Roadside Assistance Service</strong></p>\n<p>\n	ให้บริการด้านการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง เพื่อให้ลูกค้าได้รับความช่วยเหลือที่ถูกต้องและสะดวกรวดเร็วที่สุดไม่ว่าจะเป็น รถยก/รถสไลด์ เปลี่ยนยางอะไหล่ เติมน้ำมันฉุกเฉิน จั๊มแบต เป็นต้น อุ่นใจ ปลอดภัย ทุกเส้นทางไปกับบริการของเรา</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>บริการด้าน </strong><strong>Claims Service </strong></p>\n<p>\n	ให้บริการด้านการจัดการบริหารการเคลม โดยทางบริษัทจะช่วยประสานงานระหว่างศูนย์บริการ อู่ โชว์รูมรถยนต์ และลูกค้า ด้วยทักษะประสบการณ์ความรู้ ความเชี่ยวชาญทางด้านรถยนต์และการรักในการบริการ ( Service Mind ) ที่ทางบริษัทได้ฝึกอบรบพนักงานทุกคนอย่างดีเยี่ยม ทำให้พนักงานสามารถให้บริการลูกค้าได้อย่างมืออาชีพ อีกทั้งทางบริษัทยังมีระบบ Call Center ที่ทันสมัยและครบวงจรด้วยมาตรฐานระดับสากล เพื่อช่วยประสานงานระหว่างศูนย์บริการ อู่ โชว์รูมรถยนต์และลูกค้า นอกจากนี้ ทางบริษัทยังมีช่างผู้เชี่ยวชาญและมีประสบการณ์มากกว่า 20 ปี คอยให้คำปรึกษา และวิเคราะห์อาการเบื้องต้นตลอด 24 ชั่วโมง เพื่อบริการลูกค้าได้อย่างมีประสิทธิภาพ และสร้างความพึงพอใจสูงสุด</p>\n', '0000-00-00', 1);
