INSERT INTO `claim_service` (`id`, `content`, `image`, `status`, `package`, `date`) VALUES
(13, '<p>\n	<span style=\"font-size:14px;\">●&nbsp; &nbsp;Smartsure&nbsp; &nbsp;จะช่วยประสานงานระหว่างศูนย์บริการ อู่ โชว์รูมรถยนต์ และลูกค้า ด้วยทักษะประสบการณ์ความเชี่ยวชาญทางด้านรถยนต์ และการรักในการบริการที่ทางบริษัทได้ฝึกอบรบพนักงานทุกคนอย่างดีเยี่ยม&nbsp;<br />\n	●&nbsp; &nbsp;เรามีระบบ Call Center ที่ทันสมัยและครบวงจรด้วยมาตรฐานระดับสากล<br />\n	●&nbsp; &nbsp;เรามีช่างผู้เชี่ยวชาญที่มีประสบการณ์มากกว่า 20 ปี คอยให้คำปรึกษา และวิเคราะห์อาการเบื้องต้นตลอด 24 ชั่วโมง เพื่อบริการลูกค้าได้อย่างมีประสิทธิภาพ และสร้างความพึงพอใจสูงสุด</span></p>\n', 'd60b9-claim.png', 1, '', '0000-00-00');
INSERT INTO `extended_warranty` (`id`, `content`, `package_condition`, `time_period`, `responsible`, `privilege`, `except`, `unexcept`, `cover_detail`, `uncover_detail`, `mark`, `date`, `image`, `pdf`, `status`, `package`) VALUES
(50, '<div>\n	●&nbsp; &nbsp;รับรถน้อยกว่า 10 ปี</div>\n<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 1 ปี หรือ 25,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 13 รายการ</div>\n<div>\n	●&nbsp; &nbsp;ซ่อมศูนย์ในเครือ</div>\n<div>\n	●&nbsp; &nbsp;รับผิดชอบสูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ</div>\n<div>\n	●&nbsp; &nbsp;แถมฟรีบริการช่วยเหลือฉุกเฉินตลอด 24 ชั่วโมง</div>\n', '<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 150,000 กิโลเมตร และน้อยกว่า 5 ปี สามารถรับบริการได้</div>\n<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</div>\n<div>\n	●&nbsp; &nbsp;สําหรับลูกค้าที่ต้องการซ่อมศูนย์บริการ</div>\n', '<div>\n	1 ปี หรือ 25,000 กิโลเมตร</div>\n<div>\n	(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</div>\n', '<p>\n	เคลมได้สูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ</p>\n', '<p>\n	บริการช่วยเหลือรถเสียฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<div>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์เพื่อใช้บริการสาธารณะ เช่น รถตํารวจ รถดับเพลิง รถพยาบาล เป็นต้น</div>\n<div>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์เพื่อการรับจ้างสาธารณะ หรือให้เช่า รวมถึงรถยนต์ดัดแปลงสภาพการปรับแต่งเพื่อเพิ่มสมรรถนะ เช่น รถแท็กซี่ รถแข่ง เป็นต้น</div>\n<div>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์ที่มีระบบไฮบริด</div>\n<div>\n	●&nbsp; &nbsp;กรณีเป็นรถยนต์ที่ติดตั้งเชื้อเพลิงประเภทแก๊สต้องเป็นการติดตั้งเดิมจากโรงงานผู้ผลิตรถยนต์เท่านั้น (CNG)(รับเฉพาะรถญี่ปุ่นกับเกาหลี)</div>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '0000-00-00', '74431-bronze-04.png', 'd35ee-autodiamond-.pdf', 1, 'Auto Smart Diamond'),
(46, '<div>\n	●&nbsp; &nbsp;รับรถน้อยกว่า 10 ปี</div>\n<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 1 ปี หรือ 20,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 3 รายการ</div>\n<div>\n	●&nbsp; &nbsp;ซ่อมอู่ในเครือ</div>\n<div>\n	●&nbsp; &nbsp;รับผิดชอบสูงสุด 30,000 บาท ต่อครั้ง จำกัดไม่เกิน 100,000 บาท</div>\n<div>\n	●&nbsp; &nbsp;แถมฟรีบริการช่วยเหลือฉุกเฉินตลอด 24 ชั่วโมง</div>\n', '<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</div>\n<div>\n	●&nbsp; &nbsp;สงวนสิทธิ์สําหรับยี่ห้อรถยนต์ ดังนี้ Honda, Toyota, Nissan ยกเว้น GTR, Isuzu, Mazda,</div>\n<div>\n	Mitsubishi, Suzuki สําหรับยี่ห้อรถดังต่อไปนี้ Ford, Chevrolet, Subaru รถตั้งแต่ปี</div>\n<div>\n	2011-2015 คิดค่าบริการเพิ่มเติมคันละ 2,000 บาท</div>\n<div>\n	●&nbsp; &nbsp;สําหรับซ่อมอู่ในเครือ</div>\n', '<div>\n	1 ปี หรือ 20,000 กิโลเมตร</div>\n<div>\n	(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</div>\n<div>\n	&nbsp;</div>\n', '<p>\n	30,000 บาท ต่อครั้ง จํากัดไม่เกิน 100,000 บาท</p>\n', '<p>\n	บริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง</p>\n', '<div>\n	1.รถประเภท Hybrid เช่น Camry Hybrid, Toyota Prius</div>\n<div>\n	2.รถไม่ได้ติดแก๊สจากทางโรงงาน</div>\n<div>\n	3.รถเช่า เช่น รถทะเบียนป้ายเขียว</div>\n<div>\n	4.รถแต่งเครื่อง</div>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองบูซช่วงล่างโช๊คอัพ และยางแท่นเครื่อง เนื่องจากเป็นชิ้นส่วนที่สึกหรอตามอายุการใช้งาน</div>\n<div>\n	●&nbsp; &nbsp;ซีลและปะเก็น (ไม่คุ้มครองกรณีตัวอะไหล่บกพร่องโดยลําพัง)</div>\n<div>\n	●&nbsp; &nbsp;ความคุ้มครองสายพายหรือโซ้ไทม์มิ่ง จะคุ้มครองเฉพาะกรณีที่สายพานหรือโซ้ได้รับการเปลี่ยนตามระยะที่กําหนดโดยผู้ผลิตเท่านั้น (ต้องมีหลักฐานแสดง)</div>\n<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองชิ้นส่วนเสื่อมสภาพที่ส่งผลให้เกิดเสียงรบกวนและการสั่นสะเทือน</div>\n<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองวัสดุสิ้นเปลืองที่ต้องเปลี่ยนตามระยะ เช่น สายพาน หัวเทียน ไส้กรอง จานจ่าย</div>\n<div>\n	หัวนกกระจอก คอนเดนเซอร์ หน้าทองขาว สายไฟแรงสูง ที่ปัดน้ําฝน ตัวกันการเป็นน้ําแข็ง จารบี</div>\n<div>\n	เชื้อเพลิงหรือน้ํามัน ก้านเบรค ดุมเบรค จานเบรค ผ้าเบรค และของเหลวทุกชนิด เป็นต้น</div>\n', '<div>\n	●&nbsp; &nbsp;ทางบริษัทจะไม่สามารถดําเนินการได้ หากท่านไม่เปิดความคุ้มครอง กรุณาเปิดความคุ้มครอง</div>\n<div>\n	ก่อนการใช้บริการ หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจากทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</div>\n<div>\n	●&nbsp; &nbsp;ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไข</div>\n<div>\n	ความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</div>\n<div>\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</div>\n', '0000-00-00', 'e18d9-test1111-08.png', '33ba9-bronzestandard-.pdf', 1, 'Bronze Standard'),
