ร หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจากทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</div>\n<div>\n	●&nbsp; &nbsp;ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไขความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</div>\n<div>\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</div>\n<div>\n	&nbsp;</div>\n', '0000-00-00', 'd7203-bronze-02.png', 'bf893-silverstandard-.pdf', 1, 'Silver Standard'),
(48, '<div>\n	●&nbsp; &nbsp;รับรถน้อยกว่า 7 ปี</div>\n<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 100,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 1 ปี หรือ 25,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 4 รายการ</div>\n<div>\n	●&nbsp; &nbsp;ซ่อมอู่ในเครือ</div>\n<div>\n	●&nbsp; &nbsp;รับผิดชอบสูงสุด 80,000 บาท ต่อครั้ง จํากัดไม่เกิน 250,000 บาท</div>\n<div>\n	●&nbsp; &nbsp;แถมฟรีบริการช่วยเหลือฉุกเฉินตลอด 24 ชั่วโมง</div>\n', '<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 100,000 กิโลเมตร และน้อยกว่า 7 ปี สามารถรับบริการได้</div>\n<div>\n	●&nbsp; &nbsp;สําหรับซ่อมอู่ในเครือ</div>\n', '<div>\n	1 ปี หรือ 25,000 กิโลเมตร</div>\n<div>\n	(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</div>\n', '<p>\n	80,000 บาท ต่อครั้ง จํากัดไม่เกิน 250,000 บาท</p>\n', '<p>\n	บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<div>\n	1.รถประเภท Hybrid เช่น Camry Hybrid, Toyota Prius</div>\n<div>\n	2.รถยี่ห้อ Volkswagen</div>\n<div>\n	3.รถไม่ได้ติดแก๊สจากทางโรงงาน</div>\n<div>\n	4.รถเช่า เช่น รถทะเบียนป้ายเขียว</div>\n<div>\n	5.รถแต่งเครื่อง</div>\n<div>\n	&nbsp;</div>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองบูซช่วงล่างโช๊คอัพ และยางแท่นเครื่ิอง เนื่องจากเป็นชิ้นส่วนที่สึกหรอตามอายุการใช้งาน</div>\n<div>\n	●&nbsp; &nbsp;ซีลและปะเก็น (ไม่คุ้มครองกรณีตัวอะไหล่บกพร่องโดยลําพัง)</div>\n<div>\n	●&nbsp; &nbsp;ความคุ้มครองสายพายหรือโซ่ไทม์มิ่ง จะคุ้มครองเฉพาะกรณีที่สายพานหรือโซ่ได้รับการเปลี่ยนตามระยะที่กําหนดโดยผู้ผลิตเท่านั้น (ต้องมีหลักฐานแสดง)</div>\n<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองชิ้นสงวนเสื่อมสภาพที่ส่งผลให้เกิดเสียงรบกวนและการสั่นสะเทือน</div>\n<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองวัสดุสิ้นเปลืองที่ต้องเปลี่ยนตามระยะ เช่น สายพาน หัวเทียน ไส้กรอง จานจ่ายหัวนกกระจอก คอนเดนเซอร์ หน้าทองขาว สายไฟแรงสูง ที่ปัดน้ําฝน ตัวกันการเป็นน้ําแข็ง จารบีเชื้อเพลิงหรือน้ํามัน ก้านเบรค ดุมเบรค จานเบรค ผ้าเบรค และของเหลวทุกชนิด เป็นต้น</div>\n<div>\n	&nbsp;</div>\n', '<div>\n	●&nbsp; &nbsp;ทางบริษัทจะไม่สามารถดําเนินการได้ หากท่านไม่เปิดความคุ้มครอง กรุณาเปิดความคุ้มครองก่อนการใช้บริการ หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจากทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</div>\n<div>\n	●&nbsp; &nbsp;ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไขความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</div>\n<div>\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</div>\n', '0000-00-00', 'a9a12-bronze-03.png', '38c66-goldplus-.pdf', 1, 'Gold Plus'),
(49, '<div>\n	●&nbsp; &nbsp;รับรถน้อยกว่า 10 ปี</div>\n<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 1 ปี หรือ 25,000 กิโลเมตร</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครอง 3 รายการ</div>\n<div>\n	●&nbsp; &nbsp;ซ่อมศูนย์บริการ</div>\n<div>\n	●&nbsp; &nbsp;รับผิดชอบสูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ&nbsp;</div>\n<div>\n	●&nbsp; &nbsp;แถมฟรีบริการช่วยเหลือฉุกเฉินตลอด 24 ชั่วโมง</div>\n', '<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 150,000 กิโลเมตร และน้อยกว่า 5 ปี สามารถรับบริการได้</div>\n<div>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</div>\n<div>\n	●&nbsp; &nbsp;สําหรับลูกค้าที่ต้องการซ่อมศูนย์บริการ</div>\n', '<div>\n	1 ปี หรือ 25,000 กิโลเมตร</div>\n<div>\n	(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</div>\n', '<p>\n	เคลมได้สูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ</p>\n', '<p>\n	บริการช่วยเหลือรถเสียฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<div>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์เพื่อใช้บริการสาธารณะ เช่น รถตํารวจ รถดับเพลิง รถพยาบาล เป็นต้น</div>\n<div>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์เพื่อการรับจ้างสาธารณะ หรือให้เช่า รวมถึงรถยนต์ดัดแปลงสภาพการ</div>\n<div>\n	ปรับแต่งเพื่อเพิ่มสมรรถนะ เช่น รถแท็กซี่ รถแข่ง เป็นต้น</div>\n<div>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์ที่มีระบบไฮบริด</div>\n<div>\n	●&nbsp; &nbsp;กรณีเป็นรถยนต์ที่ติดตั้งเชื้อเพลิงประเภทแก๊สต้องเป็นการติดตั้งเดิมจากโรงงานผู้ผลิตรถยนต์</div>\n<div>\n	เท่านั้น (CNG)(รับเฉพาะรถญี่ปุ่นกับเกาหลี)</div>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '<p>\n	-</p>\n', '0000-00-00', 'ce4d5-bronze-05.png', '1fbae-autostandard.pdf', 1, 'Auto Smart Standard');
