INSERT INTO `news` (`id`, `news_content`, `news_detail`, `news_image`, `date`, `status`) VALUES
(12, '<p>\n	<span style=\"font-size:16px;\">งานทำบุญเลี้ยงพระเพล</span></p>\n<p>\n	<span style=\"font-size:16px;\">ถวายสังฆทานแด่พระสงฆ์ จำนวน 9 รูป</span></p>\n<p>\n	<span style=\"font-size:16px;\">วันที่ 18 สิงหาคม 2563</span></p>\n<p>\n	<span style=\"font-size:16px;\">เพื่อเสริมความเป็นสิริมงคล</span></p>\n', '<p>\n	&nbsp;</p>\n<p>\n	<span style=\"font-size:16px;\"><strong>SMARTSURE</strong> ได้มีการจัดงานทำบุญเลี้ยงพระเพล และถวายสังฆทานแด่พระสงฆ์ จำนวน 9 รูป&nbsp; ณ วันที่ 18 สิงหาคม 2563 นำโดย คุณวสวัตติ์ วสุธาสวัสดิ์ เป็นประธานในพิธี เพื่อเสริมความเป็นสิริมงคลให้แก่บริษัท ผู้บริหาร และพนักงานทุกคน</span></p>\n<p>\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<span style=\"font-size:16px;\"><img alt=\"\" src=\"/uploads/images/117971722_1202680883458424_7992486070562412414_o.jpg\" style=\"width: 500px; height: 333px;\" />&nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"/uploads/images/117967502_1202680806791765_3584478133261983043_o.jpg\" style=\"width: 500px; height: 333px;\" /></span></p>\n<p style=\"text-align: center;\">\n	&nbsp;</p>\n<p style=\"text-align: center;\">\n	<span style=\"font-size:16px;\">&nbsp; &nbsp;<img alt=\"\" src=\"/uploads/images/118154473_1202680793458433_8623952750334483587_o.jpg\" style=\"width: 500px; height: 333px;\" />&nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"/uploads/images/117833383_1202680820125097_3497556199017742117_o%20(1).jpg\" style=\"width: 500px; height: 333px;\" /></span></p>\n', '10e4c-117971722_1202680883458424_7992486070562412414_o.jpg', '2020-08-18', 1),
(14, '<p>\n	<span style=\"font-size:16px;\"><strong>Smartsure</strong> กับชมรมรถสวยศรีนครินทร์ </span></p>\n<p>\n	<span style=\"font-size:16px;\"><strong>@ Muthi Maya Forest Pool Villa Resort</strong> เขาใหญ่</span></p>\n<p>\n	วันที่ 26-27 สิงหาคม 2563</p>\n<p>\n	ขอขอบคุณทุกคนไว้วางใจ&nbsp; &nbsp;<strong>Smartsure&nbsp; &nbsp;</strong>เสมอมา</p>\n', '<p align=\"left\">\n	<strong>Smartsure</strong> กับชมรมรถสวยศรีนครินทร์ <strong>@ Muthi Maya Forest Pool Villa Resort</strong> เขาใหญ่ เมื่อวันที่ 26-27 สิงหาคม ที่ผ่านมา</p>\n<p align=\"left\">\n	ทาง&nbsp; &nbsp;<strong>Smartsure&nbsp; &nbsp;</strong>ขอขอบพระคุณทุกท่านที่สละเวลามาร่วมสัมมนาและขอขอบคุณอย่างเป็นที่สุดที่ทุกคนไว้วางใจในบริการของ <strong>Smartsure</strong> เสมอมา หวังเป็นอย่างยิ่งว่า <strong>Smartsure </strong>จะได้มีโอกาสดูแลและร่วมกิจกรรมกับพี่ๆ ทุกคนตลอดไปนะคะ</p>\n<p align=\"left\">\n	&nbsp;</p>\n<p align=\"left\">\n	<img alt=\"\" src=\"/uploads/images/118585256_1208789172847595_8028750665441534589_o.jpg\" style=\"width: 500px; height: 334px;\" /><img alt=\"\" src=\"/uploads/images/118641949_1208789189514260_5715252528743518498_o.jpg\" style=\"width: 500px; height: 334px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/118582812_1208789349514244_8113784372479356402_o.jpg\" style=\"width: 500px; height: 334px;\" /><img alt=\"\" src=\"/uploads/images/118615692_1208789182847594_292100369759348138_o.jpg\" style=\"width: 500px; height: 334px;\" /></p>\n', 'a07d7-118517254_1208789419514237_2973939164585794748_o.jpg', '2020-08-26', 1),
(15, '<p>\n	<span style=\"font-size:16px;\"><strong>SMART SURE</strong> กับภาพบรรยากาศ</span></p>\n<p>\n	<strong><span style=\"font-size:16px;\">&quot;Smart Top 10 Thank You Trip&quot;</span></strong></p>\n<p>\n	เมื่อวันที่ 21-23 กันยายน 2563</p>\n<p>\n	ขอขอบพระคุณทุกท่านที่ไว้วางใจเราเสมอมา</p>\n', '<p>\n	<strong>SMART SURE</strong> กับภาพบรรยากาศทริป</p>\n<p>\n	<strong>&quot;Smart Top 10 Thank You Trip&quot;</strong></p>\n<p>\n	@ Park Hyatt Bangkok and Sheraton Hua Hin Pranburi Villas เมื่อวันที่ 21-23 กันยายน ที่ผ่านมา ทาง <strong>SMART SURE</strong></p>\n<p>\n	ขอขอบพระคุณทุกท่านที่เดินทางมาร่วมทริปกับเราและไว้วางใจในบริการของ <strong>SMART SURE </strong>เสมอมา หวังเป็นอย่างยิ่งว่า <strong>SMART SURE</strong> จะมีโอกาสได้ดูแลและร่วมทริปกับพี่ๆ ทุกท่านตลอดไปเลยนะคะ</p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/120009880_1228969907496188_8783938938329019174_o.jpg\" style=\"width: 500px; height: 333px;\" /><img alt=\"\" src=\"/uploads/images/119976418_1228969620829550_3073446238519871315_o%20(1).jpg\" style=\"width: 500px; height: 334px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/119889066_1228969824162863_3928226625028624514_o.jpg\" style=\"width: 500px; height: 333px;\" /><img alt=\"\" src=\"/uploads/images/119892684_1228969994162846_1590320720844105429_o.jpg\" style=\"width: 500px; height: 333px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/120075589_1228970027496176_4866441171275562698_o.jpg\" style=\"width: 500px; height: 333px;\" /><img alt=\"\" src=\"/uploads/images/120165169_1228970204162825_5616656509080992599_o.jpg\" style=\"width: 500px; height: 333px;\" /></p>\n<p>\n	&nbsp;</p>\n', '11eee-119979812_1228969634162882_4795290853424638200_o.jpg', '2020-09-21', 1),
(16, '<p>\n	<strong>&nbsp;&ldquo;Smart Family Trip&rdquo;</strong></p>\n<p>\n	<span style=\"font-size:16px;\">ณ วันที่ 20-21 ตุลาคม 2563 </span></p>\n<p>\n	<span style=\"font-size:16px;\">จังหวัด นครนายก</span></p>\n<p>\n	&nbsp;</p>\n', '<p>\n	<span style=\"font-size:18px;\"><strong>&nbsp;</strong></span><strong style=\"font-size: 18px;\">&ldquo;Smart Family Trip&rdquo;</strong></p>\n<p>\n	ณ วันที่ 20-21 ตุลาคม 2563 จ. นครนายก</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>&nbsp;DAY 1</strong></p>\n<p>\n	พักจิบกาแฟชิลๆ @Cafe Laura bar &amp; restaurant สระบุรี</p>\n<p>\n	จัดโครงการ &ldquo;ปันรักปันสุขเพื่อน้อง&rdquo; ที่ &nbsp;โรงเรียนบ้านหนองอีเหลอ จ.นครราชสีมา</p>\n<p>\n	ดินเนอร์และโชว์สุดพิเศษจากวง AB Normal @Muthi Maya Forest Pool Villa Resort</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>DAY 2</strong></p>\n<p>\n	รับประทานอาหารอีสานสุดแซ่บ @เป็นลาว เขาใหญ่</p>\n<p>\n	พักผ่อนหย่อนใจท่ามกลางธรรมชาติ @ภิรมย์คาเฟ่ เขาใหญ่</p>\n<p>\n	ปิดท้ายด้วยกิจกรรมทำพิซซ่า @ เขาใหญ่ฟาร์ม</p>\n<p>\n	Smart sure ขอขอบคุณทุกท่านที่เดินทางมาร่วมทริปกับเรา</p>\n<p>\n	หวังว่าจะมีโอกาสได้ร่วมทริปสนุกๆ กับทุกท่านอีกนะคะ</p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/121821593_1253487455044433_2554088124062703606_o.jpg\" style=\"width: 500px; height: 333px;\" /><img alt=\"\" src=\"/uploads/images/122704666_1258735201186325_4358472852070864204_o.jpg\" style=\"width: 500px; height: 334px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/122033962_1253487375044441_6937736272283609769_o.jpg\" style=\"width: 500px; height: 281px;\" /><img alt=\"\" src=\"/uploads/images/122195341_1253487448377767_3512982327668340415_o.jpg\" style=\"width: 500px; height: 281px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/122446022_1253487358377776_5815421088063837811_o.jpg\" style=\"width: 500px; height: 282px;\" /><img alt=\"\" src=\"/uploads/images/122197067_1253487438377768_4507807498553157477_o.jpg\" style=\"width: 500px; height: 281px;\" /></p>\n<p>\n	&nbsp;</p>\n', '03d13-122007952_1253487365044442_863146681023688353_o.jpg', '2020-10-20', 1),
(17, '<p>\n	Smart sure กับสมาคมผู้ประกอบการรถยนต์ใช้แล้ว</p>\n<p>\n	ในค่ำคืนแห่งความภูมิใจ ณ วันที่ 11 ธันวาคม 2563</p>\n<p>\n	&quot;Association of Used Car, PROUD NIGHT&quot;</p>\n<p>\n	@The Grand Fourwings Convention Hotel</p>\n', '<p>\n	ขอขอบคุณสมาคมผู้ประกอบการรถยนต์ใช้แล้ว ที่ให้บริษัท สมาร์ทชัวร์ จำกัด ได้เป็นส่วนหนึ่งในค่ำคืนแห่งความภูมิใจครั้งนี้ค่ะ<br />\n	ภาพบรรยากาศที่เต็มไปด้วยความประทับใจ และความทรงจำดีๆ</p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/131619967_1297200570673121_869813083364905790_o(1).jpg\" style=\"width: 500px; height: 281px;\" /><img alt=\"\" src=\"/uploads/images/131109244_1297217114004800_5949964480993924718_o(1).jpg\" style=\"width: 500px; height: 281px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/130569950_1297217830671395_4952266210701633616_o(1).jpg\" style=\"width: 500px; height: 281px;\" /><img alt=\"\" src=\"/uploads/images/130291396_1297217637338081_3368540813036579388_o(1).jpg\" style=\"width: 500px; height: 281px;\" /></p>\n<p>\n	&nbsp;</p>\n<p>\n	<img alt=\"\" src=\"/uploads/images/131042005_1297220800671098_2703392108850517119_o(1).jpg\" style=\"width: 500px; height: 281px;\" /><img alt=\"\" src=\"/uploads/images/131106966_1297217234004788_3447772911026121152_o(1).jpg\" style=\"width: 500px; height: 281px;\" /></p>\n', 'b9315-130866337_1297200547339790_5574178279957291175_o.jpg', '2020-12-11', 1);
