(9, '<p>\n	●&nbsp; &nbsp;รับรถน้อยกว่า 10 ปี<br />\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร<br />\n	●&nbsp; &nbsp;คุ้มครอง 1 ปี หรือ 25,000 กิโลเมตร<br />\n	●&nbsp; &nbsp;คุ้มครอง 3 รายการ<br />\n	●&nbsp; &nbsp;รับผิดชอบสูงสุด<span style=\"font-size: 16px;\">เท่ากับยอดจัดไฟแนนซ์ ณ วันที่ซื้อ</span><br />\n	●&nbsp; &nbsp;ซ่อมศูนย์บริการ<br />\n	●&nbsp; &nbsp;แถมฟรีบริการช่วยเหลือฉุกเฉินตลอด 24 ชั่วโมง</p>\n', '<p>\n	รถทุกคันที่วิ่งไม่เกิน&nbsp;<span new=\"\" times=\"\">200,000&nbsp;</span><span angsana=\"\">กิโลเมตร และน้อยกว่า</span>&nbsp;<span new=\"\" times=\"\">10&nbsp;</span><span angsana=\"\">ปี สามารถรับบริการได้</span></p>\n', '<p>\n	1 ปี หรือ 25,000 กิโลเมตร<br />\n	(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n', '<div>\n	<span style=\"font-size:16px;\">&nbsp;เคลมได้สูงสุดเท่ากับยอดจัดไฟแนนซ์ ณ วันที่ซื้อ<br />\n	(ยอดจัดไฟแนนซ์+ภาษีมูลค่าเพิ่ม+ประกันคุ้มครองภาระหนี้)</span></div>\n', '<p>\n	<span style=\"font-size:16px;\">บริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง</span></p>\n', '<div>\n	●&nbsp; &nbsp;ไม่รับประกันรถยนต์ เพื่อใช้บริการสาธารณะ เช่น รถตำรวจ รถดับเพลิง รถพยาบาล เป็นต้น<br />\n	●&nbsp; &nbsp;ไม่รับประกันรถยนต์ เพื่อการรับจ้างสาธารณะ หรือให้เช่า รวมถึงรถยนต์ดัดแปลงสภาพการ&nbsp; ปรับแต่งเพื่อเพิ่มสมรรถนะ เช่น รถแท็กซี่ รถแข่ง เป็นต้น<br />\n	●&nbsp; &nbsp;กรณีเป็นรถยนต์ที่ติดตั้งเชื้อเพลิงประเภทแก๊สต้องเป็นการติดตั้งเดิมจากโรงงานผู้ผลิตรถยนต์&nbsp; เท่านั้น<br />\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ไม่คุ้มครองรถที่นำเข้ามาโดยผู้นำเข้าที่ไม่ใช่ตัวแทนโดยถูกต้อง (Gray market)</div>\n', '<p>\n	●&nbsp; &nbsp;ทางบริษัทจะคุ้มครองเฉพาะชิ้นส่วนของอะไหล่ที่ผลิตจากโรงงานผู้ผลิตเท่านั้น ขอสงวนสิทธิ์ไม่คุ้มครองหากกรณีที่ทางบริษัทตรวจพบว่าอะไหล่ชิ้นส่วนดังกล่าวมีการเปลี่ยน โดยไม่ใช่อะไหล่เดิมที่ผลิตจากโรงงานผู้ผลิต<br />\n	●&nbsp; &nbsp;คุ้มครองรถยนต์ไฮบริดแต่ไม่คุ้มครองอะไหล่ระบบไฮบริดและอะไหล่ส่วนที่เกี่ยวข้องทั้งหมด<br />\n	●&nbsp; &nbsp;ไม่คุ้มครองบูซช่วงล่างโช๊คอัพ และยางแท่นเครื่ิอง เนื่องจากเป็นชิ้นส่วนที่สึกหรอตามอายุ<br />\n	●&nbsp; &nbsp;ซีลและปะเก็น (ไม่คุ้มครองกรณีตัวอะไหล่บกพร่องโดยลําพัง)<br />\n	●&nbsp; &nbsp;ความคุ้มครองสายพายหรือโซ่ไทม์มิ่ง จะคุ้มครองเฉพาะกรณีที่สายพานหรือโซ่ได้รับการเปลี่ยนตามระยะที่กําหนดโดยผู้ผลิตเท่านั้น (ต้องมีหลักฐานแสดง)<br />\n	●&nbsp; &nbsp;ไม่คุ้มครองชิ้นส่วนเสื่อมสภาพที่ส่งผลให้เกิดเสียงรบกวนและการสั่นสะเทือน<br />\n	●&nbsp; &nbsp;ไม่คุ้มครองวัสดุสิ้นเปลืองที่ต้องเปลี่ยนตามระยะ เช่น สายพาน หัวเทียน ไส้กรอง จานจ่ายหัวนกกระจอก คอนเดนเซอร์ หน้าทองขาว สายไฟแรงสูง ที่ปัดน้ําฝน ตัวกันการเป็นน้ําแข็ง จารบีเชื้อเพลิงหรือน้ํามัน ก้านเบรค ดุมเบรค จานเบรค ผ้าเบรค และของเหลวทุกชนิด เป็นต้น</p>\n', '<p>\n	●&nbsp; &nbsp;ทางบริษัทจะไม่สามารถดําเนินการได้ หากท่านไม่เปิดความคุ้มครอง กรุณาเปิดความคุ้มครองก่อนการใช้บริการ หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center<br />\n	●&nbsp; &nbsp;หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจากทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี<br />\n	●&nbsp; &nbsp;ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไขความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ<br />\n	●&nbsp; &nbsp;ท่านอาจบอกเลิกสัญญารับประกันฉบับนี้ได้โดยจะต้องแจ้งให้ทางบริษัททราบเป็นหนังสือและจะมีสิทธิได้รับเงินคืนหลังจากหักค่าประกันสําหรับระยะเวลาที่สัญญารับประกันฉบับนี้ได้ใช้บังคับมาแล้วออกตามอัตรารับประกันระยะสั้นตามตารางราคาที่ได้ระบุในคู่มือการรับประกันคุณภาพทั้งนี้ท่านจะบอกเลิกสัญญารับประกันนี้ได้ต่อเมื่อไม่เคยมีการเรียกร้องค่าซ่อมแซมภายใต้สัญญารับประกันนี้มาก่อนวันที่บอกเลิกสัญญารับประกัน<br />\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า<br />\n	●&nbsp; &nbsp;หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</p>\n', '0000-00-00', '509a5-tpa-02_0.jpg', '1fd6d-oricostandard.pdf', 1, 'Orico Standard Package'),
(10, '<p>\n	●&nbsp; &nbsp;รับรถน้อยกว่า 10 ปี<br />\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร<br />\n	●&nbsp; &nbsp;คุ้มครอง 1 ปี หรือ 25,000 กิโลเมตร<br />\n	●&nbsp; &nbsp;คุ้มครอง 18 รายการ<br />\n	●&nbsp; &nbsp;รับผิดชอบสูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ<br />\n	●&nbsp; &nbsp;ซ่อมศูนย์บริการ<br />\n	●&nbsp; &nbsp;แถมฟรีบริการช่วยเหลือฉุกเฉินตลอด 24 ชั่วโมง</p>\n', '<p>\n	●&nbsp; &nbsp;รถทุกคันที่วิ่งไม่เกิน&nbsp;<span new=\"\" times=\"\">200,000&nbsp;</span><span angsana=\"\">กิโลเมตร และน้อยกว่า</span>&nbsp;<span new=\"\" times=\"\">10&nbsp;</span><span angsana=\"\">ปี สามารถรับบริการได้</span><br />\n	●&nbsp; &nbsp;สำหรับลูกค้าที่ต้องการซ่อมศูนย์บริการ</p>\n', '<p>\n	1 ปี หรือ 25,000 กิโลเมตร<br />\n	(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n', '<p>\n	เคลมได้สูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ<br />\n	(ยอดจัดไฟแนนซ์+ภาษีมูลค่าเพิ่ม+ประกันคุ้มครองภาระหนี้)</p>\n', '<p>\n	บริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง</p>\n', '<p>\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์เพื่อใช้บริการสาธารณะ เช่น รถตํารวจ รถดับเพลิง รถพยาบาล เป็นต้น<br />\n	●&nbsp; &nbsp;ไม่รับประกันภัยรถยนต์เพื่อการรับจ้างสาธารณะ หรือให้เช่า รวมถึงรถยนต์ดัดแปลงสภาพการปรับแต่งเพื่อเพิ่มสมรรถนะ เช่น รถแท็กซี่ รถแข่ง เป็นต้น<br />\n	●&nbsp; &nbsp;กรณีเป็นรถยนต์ที่ติดตั้งเชื้อเพลิงประเภทแก๊สต้องเป็นการติดตั้งเดิมจากโรงงานผู้ผลิตรถยนต์เท่านั้น</p>\n', '<p>\n	●&nbsp; &nbsp;ทางบริษัทจะคุ้มครองเฉพาะชิ้นส่วนของอะไหล่ที่ผลิตจากโรงงานผู้ผลิตเท่านั้น ขอสงวนสิทธิ์ไม่คุ้มครองหากกรณีที่ทางบริษัทตรวจพบว่าอะไหล่ชิ้นส่วนดังกล่าวมีการเปลี่ยน โดยไม่ใช่อะไหล่เดิมที่ผลิตจากโรงงานผู้ผลิต<br />\n	●&nbsp; &nbsp;คุ้มครองรถยนต์ไฮบริดแต่ไม่คุ้มครองอะไหล่ระบบไฮบริดและอะไหล่ส่วนที่เกี่ยวข้องทั้งหมด<br />\n	●&nbsp; &nbsp;ไม่คุ้มครองบูซช่วงล่างโช๊คอัพ และยางแท่นเครื่ิอง เนื่องจากเป็นชิ้นส่วนที่สึกหรอตามอายุการใช่งาน<br />\n	●&nbsp; &nbsp;ซีลและปะเก็น (ไม่คุ้มครองกรณีตัวอะไหล่บกพร่องโดยลําพัง)<br />\n	●&nbsp; &nbsp;ความคุ้มครองสายพายหรือโซ่ไทม์มิ่ง จะคุ้มครองเฉพาะกรณีที่สายพานหรือโซ่ได้รับการเปลี่ยนตามระยะที่กําหนดโดยผู้ผลิตเท่านั้น (ต้องมีหลักฐานแสดง)<br />\n	●&nbsp; &nbsp;ไม่คุ้มครองชิ้นส่วนเสื่อมสภาพที่ส่งผลให้เกิดเสียงรบกวนและการสั่นสะเทือน<br />\n	●&nbsp; &nbsp;ไม่คุ้มครองวัสดุสิ้นเปลืองที่ต้องเปลี่ยนตามระยะ เช่น สายพาน หัวเทียน ไส้กรอง จานจ่ายหัวนกกระจอก คอนเดนเซอร์ หน้าทองขาว สายไฟแรงสูง ที่ปัดน้ําฝน ตัวกันการเป็นน้ําแข็ง จารบีเชื้อเพลิงหรือน้ํามัน ก้านเบรค ดุมเบรค จานเบรค ผ้าเบรค และของเหลวทุกชนิด เป็นต้น</p>\n', '<div>\n	●&nbsp; &nbsp;ทางบริษัทจะคุ้มครองเฉพาะชิ้นส่วนของอะไหล่ที่ผลิตจากโรงงานผู้ผลิตเท่านั้น ขอสงวนสิทธิ์ไม่คุ้มครองหากกรณีที่ทางบริษัทตรวจพบว่าอะไหล่ชิ้นส่วนดังกล่าวมีการเปลี่ยน โดยไม่ใช้อะไหล่เดิมที่ผลิตจากโรงงานผู้ผลิต ถึงแม้จะผ่านการตรวจสภาพจากทางบริษัทแล้วก็ตาม</div>\n<div>\n	●&nbsp; &nbsp;คุ้มครองรถยนต์ไฮบริดแต่ไม่คุ้มครองอะไหล่ระบบไฮบริดและอะไหล่ส่วนที่เกี่ยวข้องทั้งหมด</div>\n<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองบูซช่วงล่างโช๊คอัพ และยางแท่นเครื่ิอง เนื่องจากเป็นชิ้นส่วนที่สึกหรอตามอายุการใช้งาน<br />\n	●&nbsp; &nbsp;Seals and gaskets (Alone not covered) ซีลและประเก็น (ไม่คุ้มครองกรณีตัวอะไหล่บกพร่องโดยลําพัง)</div>\n<div>\n	●&nbsp; &nbsp;ความคุ้มครองสายพายหรือโซ่ไทม์มิ่ง จะคุ้มครองเฉพาะกรณีที่สายพานหรือโซ่ได้รับการเปลี่ยนตามระยะที่กําหนดโดยผู้ผลิตเท่านั้น (ต้องมีหลักฐานแสดง)</div>\n<div>\n	●&nbsp; &nbsp;Spare parts which deterioration that causes noise and vibration are not cover ไม่คุ้มครอง</div>\n<div>\n	ชิ้นส่วนเสื่อมสภาพที่ส่งผลให้เกิดเสียงรบกวนและการสั่นสะเทือน</div>\n<div>\n	●&nbsp; &nbsp;ไม่คุ้มครองวัสดุสิ้นเปลืองที่ต้องเปลี่ยนตามระยะ เช่น สายพาน หัวเทียน ไส้กรอง จานจ่าย</div>\n<div>\n	หัวนกกระจอก คอนเดนเซอร์ หน้าทองขาว สายไฟแรงสูง ที่ปาดน้ําฝน ตัวกันการเป็นน้ําแข็ง จารบี เชื้อเพลิงหรือน้ํามัน ก้านเบรค ดุมเบรค จานเบรค ผ้าเบรค และของเหลวทุกชนิด เป็นต้น</div>\n<div>\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ไม่คุ้มครองรถที่นําเข้ามาโดยผู้นําเข้าที่ไม่ใช่ตัวแทนโดยถูกต้อง (Gray market)</div>\n<div>\n	●&nbsp; &nbsp;ทางบริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลง หากท่านตัดสินใจซื้อผลิตภัณฑ์ และบริการแล้วจะไม่สามารถคืน ผลิตภัณฑ์ หรือขอรับเงินคืนจากทางบริษัทได้ เมือคําสั่งซื้อได้รับชําระเงินเรียบร้อยแล้วทุกกรณี</div>\n<div>\n	●&nbsp; &nbsp;หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center เท่านั้น ไม่สามารถนําใบเสร็จ</div>\n<div>\n	มาเบิกย้อนหลังได้ทุกกรณี</div>\n<div>\n	●&nbsp; &nbsp;โปรดศึกษารายละเอียดเงื่อนไขความคุ้มครองได้จากคู่มือการรับประกันคุณภาพ</div>\n<div>\n	●&nbsp; &nbsp;รายละเอียดเงื่อนไข ความคุ้มครอง และข้อยกเว้น เป็นไปตามคู่มือรับประกันคุณภาพ</div>\n<div>\n	ผู้ซื้อควรทําความเข้าใจรายละเอียดความคุ้มครอง เงื่อนไขและข้อยกเว้นก่อนการตัดสินใจ</div>\n<div>\n	ซื้อประกันทุกครั้ง</div>\n<div>\n	●&nbsp; &nbsp;ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไข</div>\n<div>\n	ความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</div>\n<div>\n	●&nbsp; &nbsp;บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</div>\n<div>\n	โปรดศึกษารายละเอียดเพิ่มเติมได้ทาง www.wsmart.co.th</div>\n', '0000-00-00', 'cc32c-tpa-03_0.jpg', '67635-oricoewplatinum.pdf', 1, 'Orico EW Care Platinum');
