INSERT INTO `product` (`id`, `package`, `details`, `package_condition`, `unexcept`, `time_period`, `responsible`, `privilege`, `except`, `cover_detail`, `uncover_detail`, `mark`, `image`, `date`, `status`) VALUES
(11, 'Bronze Standard SC', '<p>\n	- รับรถไม่เกิน 10 ปี</p>\n<p>\n	- รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร</p>\n<p>\n	- แถมบริการช่วยเหลือฉุกเฉิน</p>\n<p>\n	- คุ้มครอง 3 รายการ</p>\n', '<ul>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</li>\n	<li>\n		สงวนสิทธิ์สําหรับยี่ห้อรถยนต์ดังนี้ Honda, Toyota, Nissan ยกเว้น GTR, Isuzu, Mazda,Mitsubishi, Suzuki สําหรับยี่ห้อรถดังต่อไปนี้ Ford, Chevrolet, Subaru รถตั้งแต่ปี 2011-2015 คิดค่าบริการเพิ่มเติมคันละ 2,000 บาท</li>\n	<li>\n		<strong>สําหรับซ่อมศูนย์บริการ</strong></li>\n</ul>\n<p>\n	&nbsp;</p>\n', '', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1 ปี หรือ 20,000 กิโลเมตร</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n<p>\n	&nbsp;</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;40,000 บาท ต่อครั้ง จํากัดไม่เกิน 100,000 บาท</p>\n<p>\n	&nbsp;</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n<p>\n	&nbsp;</p>\n', '<ol>\n	<li>\n		รถประเภท Hybrid เช่น Camry Hybrid, Toyota Prius</li>\n	<li>\n		รถไม่ได้ติดแก๊สจากทางโรงงาน</li>\n	<li>\n		รถเช่า เช่น รถทะเบียนป้ายเขียว</li>\n	<li>\n		รถแต่งเครื่อง</li>\n</ol>\n<p>\n	&nbsp;</p>\n', '<ul>\n	<li>\n		เครื่องยนต์</li>\n	<li>\n		เกียร์</li>\n	<li>\n		กล่อง ECO</li>\n</ul>\n<p>\n	&nbsp;</p>\n', '', '<ul>\n	<li>\n		ทางบริษัทจะไม่สามารถดําเนินการได้ หากท่านไม่เปิดความคุ้มครอง กรุณาเปิดความคุ้มครอง</li>\n	<li>\n		ก่อนการใช้บริการ หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center</li>\n	<li>\n		หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจาก</li>\n	<li>\n		ทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</li>\n	<li>\n		ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไข</li>\n	<li>\n		ความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</li>\n	<li>\n		บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</li>\n	<li>\n		หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</li>\n</ul>\n<p>\n	&nbsp;</p>\n', '877e3-bronzestandardsc-01.png', '2020-09-01', 1),
(12, 'Silver Standard', '<p>\n	- รับรถไม่เกิน 10 ปี</p>\n<p>\n	- รถทุกคันที่วิ่งไม่เกิน 140,000 กิโลเมตร</p>\n<p>\n	- แถมบริการช่วยเหลือฉุกเฉิน</p>\n<p>\n	- คุ้มครอง 3 รายการ</p>\n', '<ul>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 140,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</li>\n	<li>\n		<strong>สําหรับซ่อมอู่ในเครือ</strong></li>\n</ul>\n', '', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1 ปี หรือ 25,000 กิโลเมตร</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;40,000 บาท ต่อครั้ง จํากัดไม่เกิน 120,000 บาท</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<ol>\n	<li>\n		รถประเภท Hybrid เช่น Camry Hybrid, Toyota Prius</li>\n	<li>\n		รถยี่ห้อ Volkswagen</li>\n	<li>\n		รถไม่ได้ติดแก๊สจากทางโรงงาน</li>\n	<li>\n		รถเช่า เช่น รถทะเบียนป้ายเขียว</li>\n	<li>\n		รถแต่งเครื่อง</li>\n</ol>\n', '<ul>\n	<li>\n		เครื่องยนต์</li>\n	<li>\n		เกียร์</li>\n	<li>\n		กล่อง ECO</li>\n</ul>\n', '', '<ul>\n	<li>\n		ทางบริษัทจะคุ้มครองเฉพาะชิ้นส่วนของอะไหล่ที่ผลิตจากโรงงานผู้ผลิตเท่านั้น ขอสงวนสิทธิ์ไม่คุ้มครองหากกรณีที่ทางบริษัทตรวจพบว่าอะไหล่ชิ้นส่วนดังกล่าวมีการเปลี่ยน โดยไม่ใช้อะไหล่เดิมที่ผลิตจากโรงงานผู้ผลิต ถึงแม้จะผ่านการตรวจสภาพจากทางบริษัทแล้วก็ตาม</li>\n	<li>\n		ไม่คุ้มครองบูซชวงล่างโช๊คอัพ และยางแท่นเครื่ิอง เนื่องจากเป็นชิ้นส่วนที่สึกหรอตามอายุการใช้งาน</li>\n	<li>\n		Seals and gaskets (Alone not covered) ซีลและประเก็น (ไม่คุ้มครองกรณีตัวอะไหล่บกพร่องโดยลําพัง)</li>\n	<li>\n		ความคุ้มครองสายพายหรือโซ่ไทม์มิ่ง จะคุ้มครองเฉพาะกรณีที่สายพานหรือโซ่ได้รับการเปลี่ยนตามระยะที่กําหนดโดยผู็ผลิตเท่านั้น (ต้องมีหลักฐานแสดง)</li>\n	<li>\n		Spare parts which deterioration that causes noise and vibration are not cover ไม่คุ้มครองชิ้นส่วนเสื่อมสภาพที่ส่งผลให่เกิดเสียงรบกวนและการสั่นสะเทือน</li>\n	<li>\n		ไม่คุ้มครองวัสดุสิ้นเปลืองที่ต้องเปลี่ยนตามระยะ เช่น สายพาน หัวเทียน ไส้กรอง จานจ่ายหัวนกกระจอก คอนเดนเซอร์ หน้าทองขาว สายไฟแรงสูง ที่ปัดน้ําฝน ตัวกันการเป็นน้ําแข็ง จารบี</li>\n	<li>\n		เชื้อเพลิงหรือน้ํามัน ก้านเบรค ดุมเบรค จานเบรค ผ้าเบรค และของเหลวทุกชนิด เป็นต้น</li>\n	<li>\n		ทางบริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลง หากท่านตัดสินใจซื้อผลิตภัณฑ์ และบริการแล้วจะไม่สามารถคืน ผลิตภัณฑ์ หรือขอรับเงินคืนจากทางบริษัทได้ เมือคําสั่งซื้อได้รับชําระเงินเรียบร้อยแล้วทุกกรณี</li>\n	<li>\n		หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center เท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</li>\n	<li>\n		โปรดศึกษารายละเอียดเงื่อนไขความคุ้มครองได้จากคู่มือการรับประกันคุณภาพ</li>\n	<li>\n		รายละเอียดเงื่อนไข ความคุ้มครอง และข้อยกเว้น เป็นไปตามคู่มือรับประกันคุณภาพ</li>\n	<li>\n		ผู้ซื้อควรทําความเข้าใจรายละเอียดความคุ้มครอง เงื่อนไขและข้อยกเว้นก่อนการตัดสินใจซื้อประกันภัยทุกครั้ง</li>\n	<li>\n		ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไขความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</li>\n	<li>\n		บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้าโปรดศึกษารายละเอียดเพิ่มเติมได้ทาง www.wsmart.co.th</li>\n</ul>\n', 'd57ad-silverstandard-01.png', '2020-09-01', 1),
(10, 'Bronze Standard', '<p>\n	- รับรถไม่เกิน 10 ปี</p>\n<p>\n	- รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร</p>\n<p>\n	- แถมบริการช่วยเหลือฉุกเฉิน</p>\n<p>\n	- คุ้มครอง 3 รายการ</p>\n', '<ul>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</li>\n	<li>\n		สงวนสิทธิ์สําหรับยี่ห้อรถยนต์ดังนี้ Honda, Toyota, Nissan ยกเว้น GTR, Isuzu, Mazda,Mitsubishi, Suzuki สําหรับยี่ห้อรถดังต่อไปนี้ Ford, Chevrolet, Subaru รถตั้งแต่ปี2011-2015 คิดค่าบริการเพิ่มเติมคันละ 2,000 บาท</li>\n	<li>\n		<strong>สําหรับซ่อมอู่ในเครือ</strong></li>\n</ul>\n', '', '<div>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1 ปี หรือ 20,000 กิโลเมตร</div>\n<div>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</div>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 30,000 บาท ต่อครั้ง จํากัดไม่เกิน 100,000 บาท</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<ol>\n	<li>\n		รถประเภท Hybrid เช่น Camry Hybrid, Toyota Prius</li>\n	<li>\n		รถไม่ได้ติดแก๊สจากทางโรงงาน</li>\n	<li>\n		รถเช่า เช่น รถทะเบียนป้ายเขียว</li>\n	<li>\n		รถแต่งเครื่อง</li>\n</ol>\n', '<ul>\n	<li>\n		เครื่องยนต์</li>\n	<li>\n		เกียร์</li>\n	<li>\n		กล่อง ECO</li>\n</ul>\n', '', '<ul>\n	<li>\n		ทางบริษัทจะไม่สามารถดําเนินการได้ หากท่านไม่เปิดความคุ้มครอง กรุณาเปิดความคุ้มครอง</li>\n	<li>\n		ก่อนการใช้บริการ หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center</li>\n	<li>\n		หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจาก</li>\n	<li>\n		ทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</li>\n	<li>\n		ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไข</li>\n	<li>\n		ความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</li>\n	<li>\n		บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</li>\n	<li>\n		หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</li>\n</ul>\n', 'd02bb-bronzestandard-01.png', '2020-09-01', 1),
(13, 'Gold Plus', '<p>\n	- รับรถไม่เกิน 7 ปี</p>\n<p>\n	- รถทุกคันที่วิ่งไม่เกิน 100,000 กิโลเมตร</p>\n<p>\n	- แถมบริการช่วยเหลือฉุกเฉิน</p>\n<p>\n	- คุ้มครอง 3 รายการ</p>\n', '<ul>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 100,000 กิโลเมตร และน้อยกว่า 7 ปี สามารถรับบริการได้</li>\n	<li>\n		<strong>สําหรับซ่อมอู่ในเครือ</strong></li>\n</ul>\n', '', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1 ปี หรือ 25,000 กิโลเมตร</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 80,000 บาท ต่อครั้ง จํากัดไม่เกิน 250,000 บาท</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<ul>\n	<li>\n		รถประเภท Hybrid เช่น Camry Hybrid, Toyota Prius</li>\n	<li>\n		รถยี่ห้อ Volkswagen</li>\n	<li>\n		รถไม่ได้ติดแก๊สจากทางโรงงาน</li>\n	<li>\n		รถเช่า เช่น รถทะเบียนป้ายเขียว</li>\n	<li>\n		รถแต่งเครื่อง</li>\n</ul>\n', '<ul>\n	<li>\n		เครื่องยนต์</li>\n	<li>\n		เกียร์</li>\n	<li>\n		กล่อง ECO</li>\n</ul>\n', '', '<ul>\n	<li>\n		ทางบริษัทจะไม่สามารถดําเนินการได้ หากท่านไม่เปิดความคุ้มครอง กรุณาเปิดความคุ้มครอง</li>\n	<li>\n		ก่อนการใช้บริการ หากท่านต้องการทราบรายละเอียดเพิ่มเติม กรุณาติดต่อ Call Center</li>\n	<li>\n		หากท่านต้องการใช้บริการต้องแจ้งเหตุมาทาง Call Center และต้องได้รับการอนุมัติการซ่อมจาก</li>\n	<li>\n		ทางบริษัทเท่านั้น ไม่สามารถนําใบเสร็จมาเบิกย้อนหลังได้ทุกกรณี</li>\n	<li>\n		ข้อมูลทั้งหมดที่แสดงในเอกสารนี้เป็นข้อมูลเบื้องต้นโดยสังเขป ไม่สามารถใช้ทดแทนเงื่อนไข</li>\n	<li>\n		ความคุ้มครอง ข้อยกเว้น และข้อกําหนดต่างๆภายใต้เงื่อนไขการรับประกันคุณภาพ</li>\n	<li>\n		บริษัทขอสงวนสิทธิ์ในการเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า</li>\n	<li>\n		หากท่านต้องการทราบรายละเอียดเพิ่มเติม โปรดติดต่อ 02-057-1223</li>\n</ul>\n', 'd5e9f-goldplus-01.png', '2020-09-01', 1),
(14, '	\n			Auto Smart Standard', '<p>\n	- รถทุกคันที่วิ่งไม่เกิน 150,000 กิโลเมตร และน้อยกว่า 5 ปี</p>\n<p>\n	- รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี</p>\n<p>\n	- แถมบริการช่วยเหลือฉุกเฉิน</p>\n<p>\n	- คุ้มครอง 3 รายการ</p>\n', '<ul>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 150,000 กิโลเมตร และน้อยกว่า 5 ปี สามารถรับบริการได้</li>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</li>\n	<li>\n		<strong>สําหรับลูกค้าที่ต้องการซ่อมศูนย์บริการ</strong></li>\n</ul>\n', '', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1 ปี หรือ 25,000 กิโลเมตร</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เคลมได้สูงสุดเท่ากับมูลค้าของรถยนต์ ณ วันที่ซื้อ</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<ul>\n	<li>\n		ไม่รับประกันภัยรถยนต์เพื่อใช้บริการสาธารณะ เช่น รถตํารวจ รถดับเพลิง รถพยาบาล เป็นต้น</li>\n	<li>\n		ไม่รับประกันภัยรถยนต์เพื่อการรับจ้างสาธารณะ หรือให้เช่า รวมถึงรถยนต์ดัดแปลงสภาพการปรับแต่งเพื่อเพิ่มสมรรถนะ เช่น รถแท็กซี่ รถแข่ง เป็นต้น</li>\n	<li>\n		ไม่รับประกันภัยรถยนต์ที่มีระบบไฮบริด</li>\n	<li>\n		กรณีเป็นรถยนต์ที่ติดตั้งเชื้อเพลิงประเภทแก๊สต้องเป็นการติดตั้งเดิมจากโรงงานผู้ผลิตรถยนต์เท่านั้น (CNG) (รับเฉพาะรถญี่ปุ่นกับเกาหลี)</li>\n</ul>\n', '<ul>\n	<li>\n		เครื่องยนต์</li>\n	<li>\n		เกียร์</li>\n	<li>\n		กล่อง ECO</li>\n</ul>\n', '', '', '37ad7-autostandard-01.png', '2020-09-01', 1),
(16, 'Auto Smart Diamond', '<p>\n	- รถทุกคันที่วิ่งไม่เกิน 150,000 กิโลเมตร และน้อยกว่า 5 ปี</p>\n<p>\n	- รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี</p>\n<p>\n	- แถมบริการช่วยเหลือฉุกเฉิน</p>\n<p>\n	- คุ้มครอง 18 รายการ</p>\n', '<ul>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 150,000 กิโลเมตร และน้อยกว่า 5 ปี สามารถรับบริการได้</li>\n	<li>\n		รถทุกคันที่วิ่งไม่เกิน 200,000 กิโลเมตร และน้อยกว่า 10 ปี สามารถรับบริการได้</li>\n	<li>\n		<strong>สําหรับลูกค้าที่ต้องการซ่อมศูนย์บริการ</strong></li>\n</ul>\n', '', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1 ปี หรือ 25,000 กิโลเมตร</p>\n<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (ไม่ว่าเหตุการณ์ใดเหตุการณ์หนึ่งได้เกิดขึ้นก่อน)</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เคลมได้สูงสุดเท่ากับมูลค่าของรถยนต์ ณ วันที่ซื้อ</p>\n', '<p>\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; บริการช่วยเหลือฉุกเฉินบนท้องถนน 24 ชั่วโมง</p>\n', '<ul>\n	<li>\n		ไม่รับประกันภัยรถยนต์เพื่อใช้บริการสาธารณะ เช่น รถตํารวจ รถดับเพลิง รถพยาบาล เป็นต้น</li>\n	<li>\n		ไม่รับประกันภัยรถยนต์เพื่อการรับจ้างสาธารณะ หรือให้เช่า รวมถึงรถยนต์ดัดแปลงสภาพการปรับแต่งเพื่อเพิ่มสมรรถนะ เช่น รถแท็กซี่ รถแข่ง เป็นต้น</li>\n	<li>\n		ไม่รับประกันภัยรถยนต์ที่มีระบบไฮบริด</li>\n	<li>\n		กรณีเป็นรถยนต์ที่ติดตั้งเชื้อเพลิงประเภทแก๊สต้องเป็นการติดตั้งเดิมจากโรงงานผู้ผลิตรถยนต์เท่านั้น (CNG) (รับเฉพาะรถญี่ปุ่นกับเกาหลี)</li>\n</ul>\n', '<ul>\n	<li>\n		เครื่องยนต์</li>\n	<li>\n		เกียร์</li>\n	<li>\n		ชุดเพลาหน้าและท้าย</li>\n	<li>\n		ระบบไฟฟ้า</li>\n	<li>\n		ระบบระบายความร้อนเครื่องยนต์</li>\n	<li>\n		ระบบกันสะเทือนหน้าและหลัง</li>\n	<li>\n		ระบบฉีดน้ำมันเชื้อเพลิงและควบคุมมลภาวะ</li>\n	<li>\n		ชิ้นส่วนไฮเทค</li>\n	<li>\n		ระบบความปลอดภัย (Active)</li>\n	<li>\n		ระบบความสะดวกสบายในห้องโดยสาร</li>\n	<li>\n		ระบบขับเคลื่อนสี่ล้อ</li>\n	<li>\n		ระบบความปลอดภัย (Passive)</li>\n	<li>\n		ระบบบังคับเลี้ยว</li>\n	<li>\n		ระบบรักษาความปลอดภัย</li>\n	<li>\n		เทอร์โบ</li>\n	<li>\n		ระบบเชื้อเพลิง</li>\n</ul>\n', '', '', '5f15e-autodiamond-01.png', '2020-09-01', 1);
INSERT INTO `product1` (`id`, `content`, `link_youtube`, `date`, `status`) VALUES
(2, '<p>\n	<span style=\"font-size:16px;\"><strong>บริษัท สมาร์ท ชัวร์ จำกัด </strong>เป็นบริษัทที่ให้บริการด้านบริการหลังการขายอย่างครบวงจรสำหรับผู้ประกอบการด้านรถยนต์โดยเฉพาะ&nbsp;</span><span style=\"font-size: 16px;\">โดยคัดสรรบริการหลากหลายรูปแบบ ไม่ว่าจะเป็นโปรแกรมขยายเวลารับประกันอะไหล่รถยนต์ บริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชม. บริการด้านการเคลม เพื่อให้คุ้มค่าและตรงตามความต้องการของคุณมากที่สุด&nbsp;</span><span style=\"font-size: 16px;\">สมาร์ท ชัวร์&nbsp; จึงได้ขึ้นชื่อว่าเป็นหนึ่งในบริษัทบริการหลังการขายสำหรับผู้ประกอบการด้านรถยนต์ที่ใหญ่ที่สุดในอาเซียน&nbsp;</span></p>\n', '', '0000-00-00', 1);
INSERT INTO `product2` (`id`, `content`, `link_youtube`, `date`, `status`) VALUES
(2, '<p>\n	ตัวอย่างภาพความประทับใจจากงาน</p>\n<p>\n	<strong>&quot;SMART TOP 10 THANK YOU TRIP&quot;</strong></p>\n<p>\n	@Sheraton Hua Hin Pranburi Villa</p>\n<p>\n	วันที่ 21-23 กันยายน 2563</p>\n<p>\n	สำหรับคลิปเต็ม รอพบกันเร็วๆ นี้</p>\n', 'https://youtu.be/TcSD7nbII0E', '2020-09-21', 1);
INSERT INTO `product3` (`id`, `content`, `link_youtube`, `date`, `status`) VALUES
(1, '<p>\n	<span style=\"font-size: 16px;\">●&nbsp; &nbsp;</span>บริษัท สมาร์ท ชัวร์ มีบริการ Extended Warranty ที่ครอบคลุมในทุกด้าน และบริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง&nbsp;</p>\n<p>\n	<span style=\"font-size: 16px;\">●&nbsp; &nbsp;บริษัท สมาร์ท ชัวร์&nbsp;</span>มีบริษัทชั้นนำที่เข้ามาขยายเวลารับประกันอะไหล่รถยนต์&nbsp; พร้อมจะดูแลค่าใช้จ่ายในการซ่อมอะไหล่รถยนต์ ทำให้ลูกค้าอุ่นใจ ไร้กังวลเรื่องค่าใช้จ่ายและทำให้สะดวกรวดเร็วมากขึ้น</p>\n<p>\n	<span style=\"font-size: 16px;\">●&nbsp; บริษัท สมาร์ท ชัวร์&nbsp;</span>มีธนาคารต่างๆเข้ามาช่วยดำเนินการ ดูแลเรื่องค่าใช้จ่าย พร้อมทำให้คุณหายห่วงด้วยการรับรองจากสำนักงานคุ้มครองสิทธิประโยชน์ด้านประกันวินาศภัย</p>\n', '', '2020-12-04', '1');
