(2, '<div>\n	ให้บริการด้านการบริหาร บริการช่วยเหลือฉุกเฉินบนท้องถนนตลอด 24 ชั่วโมง โดยเราจะให้บริการ Call center อย่างครบวงจร และมีมาตรฐานสากล อีกทั้งทางบริษัทยังให้บริการด้านการเคลม ที่มีประสบการณ์ทางด้านรถยนต์โดยเฉพาะ โดยทางบริษัทจะช่วยประสานงานระหว่างศูนย์บริการ อู่ โชว์รูมรถยนต์ ประกันวินาศภัย และลูกค้า&nbsp;และทางบริษัทยังมีช่างผู้เชี่ยวชาญและมีประสบการณ์มากกว่า 20 ปี คอยให้คำปรึกษาและวิเคราะห์อาการเบื้องต้นตลอด 24 ชั่วโมง เพื่อบริการลูกค้าได้อย่างมีประสิทธิภาพ และสร้างความพึงพอใจสูงสุด</div>\n', '348f2-tpa-01_0.jpg', '1be4d-tpaservice-01.png', '1', 'Package', '0000-00-00');
